# 1 "MyLex.fsl"
 
 
module CubyLex
  
open Microsoft.FSharp.Text.Lexing
open CubyPar;

let lexemeAsString lexbuf = 
    LexBuffer<char>.LexemeString lexbuf

let keyword s =
    match s with
    | "char"    -> CHAR 
    | "else"    -> ELSE
    | "false"   -> CSTBOOL 0
    | "if"      -> IF
    | "int"     -> INT
    | "float"   -> FLOAT
    | "null"    -> NULL
    | "print"   -> PRINT
    | "println" -> PRINTLN
    | "return"  -> RETURN
    | "true"    -> CSTBOOL 1
    | "void"    -> VOID 
    | "do"      -> DO
    | "case"    -> CASE    
    | "switch"  -> SWITCH   
    | "while"   -> WHILE   
    | "for"     -> FOR     
    | "in"      -> IN 
    | "break"   -> BREAK
    | "continue"-> CONTINUE
    | "string"  -> STRING
    | "try"     -> TRY
    | "catch"   -> CATCH
    | "throw"   -> THROW
    | "struct"  -> STRUCT
    | _         -> NAME s
 
let cEscape s = 
    match s with 
    | "\\\\" -> '\\'
    | "\\\"" -> '\"'
    | "\\a"  -> '\007'
    | "\\b"  -> '\008'
    | "\\t"  -> '\t'
    | "\\n"  -> '\n'
    | "\\v"  -> '\011'
    | "\\f"  -> '\012'
    | "\\r"  -> '\r'
    | _      -> failwith "Lexer error: impossible C escape"

